DELIMITER $$
--
-- Procedures
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `CleanupExpiredOTPs` ()   BEGIN
    -- Mark expired OTPs as used
    UPDATE otp_verifications 
    SET used = 1, invalidated_at = NOW() 
    WHERE expires_at < NOW() AND used = 0 AND invalidated_at IS NULL;
    
    -- Delete old OTP records (older than 30 days)
    DELETE FROM otp_verifications 
    WHERE created_at < DATE_SUB(NOW(), INTERVAL 30 DAY);
    
    -- Clean up expired lockouts
    DELETE FROM otp_lockouts 
    WHERE lockout_until < NOW();
    
    -- Clean up old security logs (older than 90 days for INFO, 180 days for others)
    DELETE FROM security_logs 
    WHERE severity = 'INFO' AND created_at < DATE_SUB(NOW(), INTERVAL 90 DAY);
    
    DELETE FROM security_logs 
    WHERE severity IN ('WARNING', 'ERROR', 'CRITICAL') 
    AND created_at < DATE_SUB(NOW(), INTERVAL 180 DAY);
END$$

DELIMITER ;

