--
-- Structure for view `category_spending`
--
DROP TABLE IF EXISTS `category_spending`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `category_spending`  AS SELECT `a`.`account` AS `account`, `t`.`name` AS `category`, sum(case when `h`.`sender` = `a`.`account` then `h`.`amount` else 0 end) AS `total_spent`, count(case when `h`.`sender` = `a`.`account` then 1 end) AS `transaction_count` FROM ((`accounts_info` `a` join `account_history` `h` on(`a`.`account` = `h`.`account`)) join `transaction_types` `t` on(`h`.`type` = `t`.`id`)) GROUP BY `a`.`account`, `t`.`name` ;

